import React from 'react';
import './UrlInput.css';

const UrlInput = ({ url, onChange }) => {
  return (
    <div className="url-input-container">
      <input
        type="text"
        className="url-input"
        placeholder="输入请求URL (例如: https://api.example.com/users)"
        value={url}
        onChange={(e) => onChange(e.target.value)}
      />
    </div>
  );
};

export default UrlInput;
